(1355, 'about_page_full_width_service_section_en_GB_title', 'Who we are?', '2021-04-24 06:08:44', '2024-06-30 19:31:47'),
(1356, 'about_page_full_width_service_section_en_GB_description', 'Welcome to our travel world! We are passionate explorers dedicated to making your travel dreams a reality. With years of experience and a love for adventure, we offer unique and personalized travel experiences that take you off the beaten path. Whether you\'re seeking cultural immersion, breathtaking landscapes, or thrilling adventures, we\'re here to guide you every step of the way.', '2021-04-24 06:08:44', '2024-06-30 19:31:47'),
(1357, 'about_page_full_width_service_section_en_GB_features', 'Customized Travel Plans: Tailor-made itineraries to match your preferences and budget.\r\nExpert Travel Guides: Knowledgeable guides providing in-depth local insights.\r\n24/7 Customer Support: Assistance available at any time, anywhere.\r\nExclusive Deals and Discounts: Access to special offers and promotions.\r\nEco-Friendly Travel Options: Sustainable travel choices to minimize your carbon footprint.\r\nCultural Immersion Experiences: Authentic local experiences to connect with the culture.\r\nSecure Online Booking: Safe and easy booking process for peace of mind.\r\nFlexible Payment Options: Various payment methods to suit your convenience.', '2021-04-24 06:08:44', '2024-06-30 19:31:47'),
(1358, 'about_page_full_width_service_section_en_GB_support_title', 'We are 24/5 available', '2021-04-24 06:08:44', '2024-06-30 19:31:47'),
(1359, 'about_page_full_width_service_section_en_GB_support_details', '011111111', '2021-04-24 06:08:44', '2024-06-30 19:31:47'),
(1360, 'about_page_full_width_service_section_ar_title', 'من نحن؟', '2021-04-24 06:08:44', '2022-01-22 13:48:40'),
(1361, 'about_page_full_width_service_section_ar_description', 'تعلن شركه شركه بايو مديكال انجنير  \r\nBME.co\r\nعن وصل اقوي 💪💪💪💪💪\r\nو افضل اجهزه اصلاح البورد الالكترونيه في العالم 👌 \r\nبأحدث التكنولوجيا الانجليزيه \r\nو نقدم كل الدعم لجميع عملائنا الكرام \r\nيعني جهازك بوردته فيها مشكله علطول تنورنا \r\nو يسعدنا تواصلكم معانا علي ارقام الشركه \r\nو انتظروا اقوي المفاجئات و العروض مع بدايه العام الجديد🥰🥰🥰🥰\r\nو بدايه جديده و قويه  لشركتنا  \r\nو نقدم افضل خدمه ان شاء الله  \r\nبدعمكم لنا نتقدم دائما للافضل \r\nو ان شاء الله عام سعيد علينا جميعا و دعواتكم بالتوفيق \r\nتحياتي', '2021-04-24 06:08:44', '2022-01-22 13:48:40'),
(1362, 'about_page_full_width_service_section_ar_features', 'الرؤيه : مؤسسة متمكنة من ادواتها لخلق مجتمع قادر على المعرفة و الوصول لكافة حقوقه و تمكينه من أدواته التنموية على المستوى الإقتصادي و الإجتماعي و القانوني و الصحي من خلال المشاركة مع كافة قطاعات المجتمع للوصول إلى بيئة خالية من الوصم و التمييز\r\nالمهمه : دعم و تمكين المجموعات المهمشة فى الوصول و الدفاع عن حقوقهم الأساسية من خلال منهجية متكاملة للتنمية الشاملة', '2021-04-24 06:08:44', '2022-01-22 13:48:40'),
